import React from "react";
import "./Partners.css";
import { Container, Row, Col, Carousel } from "react-bootstrap";
import Partner from "./Partner";

export default function Features() {
  return (
    <div
      className="features"
      style={{ backgroundImage: 'url("./assets/features-light.png")' }}
    >
      <Carousel>
        <Carousel.Item>
          <img
            width={900}
            height={500}
            alt="900x500"
            src="src/assets/construction-maison.jpg"
          />
          <Carousel.Caption>
            <h3>First slide label</h3>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img
            width={900}
            height={500}
            alt="900x500"
            src="src/assets/chantier.jpg"
          />
          <Carousel.Caption>
            <h3>Second slide label</h3>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img
            width={900}
            height={500}
            alt="900x500"
            src="src/assets/Maison_en_construction_Demoli.jpg"
          />
          <Carousel.Caption>
            <h3>Third slide label</h3>
            <p>
              Praesent commodo cursus magna, vel scelerisque nisl consectetur.
            </p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    </div>
  );
}
